public static SimpleDateFormat createSimpleDateFormat() {
  SimpleDateFormat format =
    new SimpleDateFormat("yyyy-MM-dd'T'HH:mm:ss.SSS");
  format.setTimeZone(TimeZone.getTimeZone("UTC"));
  return format;
}
